  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0108156 includes chemical,
  discrete sample, meteorological, physical, profile and underway - surface data collected
  from NOAA Ship RONALD H. BROWN in the North Atlantic Ocean and South Atlantic Ocean
  from 2010-03-08 to 2010-04-17 and retrieved during cruise 33RO20100308, AJAX and
  RB 07-05. These data include ALKALINITY, BAROMETRIC PRESSURE, CARBON DIOXIDE - AIR,
  CARBON DIOXIDE - PARTIAL PRESSURE - DIFFERENCE, CHLOROFLUOROCARBON-11 (CFC-11),
  CHLOROFLUOROCARBON-12 (CFC-12), Carbon tetrachloride (CCL4), DELTA CARBON-13, DELTA
  CARBON-14, DELTA HELIUM-3, DISSOLVED INORGANIC CARBON, DISSOLVED ORGANIC CARBON,
  DISSOLVED OXYGEN, HELIUM, HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHOSPHATE, Partial
  pressure (or fugacity) of carbon dioxide, Potential temperature (theta), SALINITY,
  SEA SURFACE TEMPERATURE, SILICATE, SULFUR HEXAFLUORIDE (SF6), TRITIUM, Total Dissolved
  Nitrogen (TDN), WATER TEMPERATURE and pH. The instruments used to collect these
  data include Alkalinity titrator, CTD, Carbon dioxide (CO2) gas analyzer, Coulometer
  for DIC measurement, Flask with closed headspace for discrete carbon dioxide (CO2)
  measurement, Shower head chamber equilibrator for autonomous carbon dioxide (CO2)
  measurement, Spectrophotometer for pH measurement and bottle. These data were collected
  by Dennis Hansell of Rosenstiel School of Marine and Atmospheric Science, Andrew
  Dickson of Scripps Institution of Oceanography, Dr. Rik H. Wanninkhof and Rik Wanninkhof
  of US DOC; NOAA; OAR; Atlantic Oceanographic and Meteorological Laboratory and Richard
  A. Feely of US DOC; NOAA; OAR; Pacific Marine Environmental Laboratory as part of
  the CLIVAR_A13.5_2010 and CLIVAR_A13.5_2010_Underway_Data data set.nnThe International
  CLIVAR Global Ocean Carbon and Repeat Hydrography Program carries out a systematic
  and global re-occupation of select WOCE/JGOFS hydrographic sections to quantify
  changes in storage and transport of heat, fresh water, carbon dioxide (CO2), and
  related parameters.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
